import RowWithDots from "./row_with_dots";
import RowWithVerticalLines from "./row_with_vl";
import React, { Component } from "react";

const Board = ({empty_box_ids, handleClick}) => {

    return (
        <div className="board">
            <table>
                <tbody>
                    <RowWithDots handleClick={handleClick}/>
                    <RowWithVerticalLines empty_box_ids={empty_box_ids[0]} handleClick={handleClick}/>
                    <RowWithDots handleClick={handleClick}/>
                    <RowWithVerticalLines empty_box_ids={empty_box_ids[1]} handleClick={handleClick}/>
                    <RowWithDots handleClick={handleClick}/>
                    <RowWithVerticalLines empty_box_ids={empty_box_ids[2]} handleClick={handleClick}/>
                    <RowWithDots handleClick={handleClick}/>
                </tbody>
            </table>
        </div>
    )

}

export default Board;
